  input: "\"TEXT\",\"F3XA\",\"C00143743\",\"August 6, 2007    Mr. Daniel T. Buckley
    \ Federal Election Commission  Washington, D. C., 20463    Re:\tJune Monthly Report
    (May 1 - May 31, 2007)    Dear Mr. Buckley:  Pursuant to your letter dated July
    6, 2007, we are filing this amended report.  The Republican Party requests on
    each original solicitation in a clear and conspicuous manner the employer and
    occupation of the donor being solicited and informs the contributor of the requirements
    of federal law for the reporting of such information.  Follow-up letters are mailed
    to each donor, within thirty days of receipt, clearly asking for the missing information,
    without soliciting an additional contribution, and once again informing the contributor
    of the requirements of federal law for the reporting of such information.  The
    letter includes a response device and return envelope for the donor.  We have
    updated the employer and occupation information on several donors reported on
    this report and will submit future amendments for any additional donor occupation
    and employer information that may be received.   Respectfully submitted, Wayne
    Tucker, Treasurer\""
